  window.showBasicInfoLightbox = function(opts) {
    var defaults, options;
    if (opts == null) {
      opts = {};
    }
    if (opts) {
      window.launch_from_engagement = opts.launch_from_engagement;
    }
    if (opts) {
      window.launch_from_analytics = opts.launch_from_analytics;
    }
    defaults = {
      padding: 0,
      type: 'ajax',
      href: '/lightboxes/set_basic_info_lightbox',
      wrapCSS: 'locked-lightboxes',
      openEffect: 'fade',
      openSpeed: 1000,
      closeEffect: 'fade',
      closeSpeed: 1000,
      afterClose: function() {
        $(document).trigger('lbBasicInfoLightboxClose');
        $('#launch').addClass("unselected").removeClass("selected completed");
        if (opts.onClose) {
          return opts.onClose();
        }
      },
      afterShow: function() {
        $(document).trigger('lbBasicInfoLightboxShow');
        initBasicInfoLightbox();
        window.reloadAfterSettingCall = true;
        if (opts.onShow) {
          return opts.onShow();
        }
      }
    };
    options = $.extend(defaults, opts.fancyOpts);
    $.fancybox(options);
    if (!window.showBasicInfoLightboxBindedForm && !opts.forceRebindForm) {
      window.showBasicInfoLightboxBindedForm = true;
      return $(document).on('ajax:success', '#set-basic-info-lightbox #business_attribute_form_10', function(event, data) {
        return $.ajax({
          type: "GET",
          url: Routes.dashboard_ajax_get_punchcard_mode_path(),
          contentType: 'application/json; charset=utf-8',
          success: function(data) {
            return $.ajax({
              type: "GET",
              url: Routes.dashboard_publish_business_path(),
              contentType: 'application/json; charset=utf-8',
              success: function(data2) {
                if (window.launch_from_engagement === true) {
                  $.fancybox.close();
                  if (window.defined_hash) {
                    window.defined_hash['launched'] = true;
                  }
                  $('.completed-launch-pseudo-link').trigger('click');
                }
                if (window.launch_from_analytics) {
                  location.reload();
                }
                window.punchcard_mode = data.pc_mode;
                if (window.punchcard_mode === 'walkin') {
                  $.fancybox.close();
                  return window.openVisitPCLightbox();
                } else {
                  $.fancybox.close();
                  return window.openQRPCLightbox();
                }
              }
            });
          }
        });
      });
    }
  };

