(function() {
  var NodeObject;

  NodeObject = (function() {
    function NodeObject() {
      this.socket = null;
      this.refreshTimout = null;
      this.connectToNode();
    }

    NodeObject.prototype.connectToNode = function() {
      var nodeObject;
      nodeObject = this;
      if (!this.socket) {
        nodeObject.socket = io(gon.node_server, {
          secure: true,
          reconnection: true,
          reconnectionDelay: 10000,
          reconnectionDelayMax: 30000,
          reconnectionAttempts: 20
        });
        console.log("first try to connect");
      }
      nodeObject.socket.on('connect', function(msg) {
        console.log("trying to authenticate with " + gon.oauth_token);
        this.emit('authenticate', gon.oauth_token);
      });
      nodeObject.socket.on('authenticate', function(msg) {
        if (msg === "success") {
          console.log("connected!");
          clearTimeout(nodeObject.refreshTimout);
          nodeObject.refreshTimout;
          if (window.initialize_am_chat) {
            $.ajax({
              url: Routes.ajax_get_am_chat_sent_path(),
              success: function(data) {
                return window.initialize_am_chat = null;
              },
              error: function(data) {}
            });
          }
        } else {
          if (msg === "unauthorized" || msg === "expired") {
            nodeObject.refreshoAuthToken();
            console.log("Got error on Authenticate: " + msg);
          }
        }
      });
      nodeObject.socket.on('chat', function(msg) {
        var $new_message, handled_message, ref, should_open_chat_instance;
        if (window.insertNewMessagebyUserId !== void 0) {
          handled_message = false;
          if ((msg.key != null)) {
            $new_message = $('*[data-messagekey=' + msg.key + ']');
            if ($new_message.length > 0) {
              $new_message.animate({
                opacity: 1
              });
              handled_message = true;
            }
          }
          should_open_chat_instance = true;
          if (!((ref = msg.message_type) === "text" || ref === "rate" || ref === "image")) {
            should_open_chat_instance = false;
          }
          if (!handled_message) {
            window.insertNewMessagebyUserId(msg.uid, msg, should_open_chat_instance);
          }
        }
      });
      nodeObject.socket.on('feed', function(msg) {
        if (window.insertNewNotificationToFeed !== void 0) {
          window.insertNewNotificationToFeed(msg);
        }
      });
      nodeObject.socket.on('categories', function(categories) {
        if (window.insertNewCategoriesToFeed !== void 0) {
          window.insertNewCategoriesToFeed(categories);
        }
      });
      nodeObject.socket.on('disconnect', function(event) {
        return console.log("got Disconnect");
      });
    };

    NodeObject.prototype.refreshoAuthToken = function() {
      var nodeObject;
      nodeObject = this;
      console.log("Trying to refresh");
      return $.get("/dashboard/api_refresh_access_token").done(function(data) {
        console.log("refreshed access token: " + data.oauth_token);
        gon.oauth_token = data.oauth_token;
        nodeObject.refreshTimout = null;
        return nodeObject.socket.connect();
      });
    };

    NodeObject.prototype.sendChatMessage = function(data) {
      return this.socket.emit('send', data);
    };

    NodeObject.prototype.searchCategoryTerm = function(data) {
      return this.socket.emit('search', data);
    };

    return NodeObject;

  })();

  window.globalNode = new NodeObject();

}).call(this);
